package com.melonlee.api.bean;public class ProjectBean {	private int id;	private String title;	private String createDate;	public int getId() {		return id;	}	public void setId(int id) {		this.id = id;	}	public String getTitle() {		return title;	}	public void setTitle(String title) {		this.title = title;	}	public String getCreateDate() {		return createDate;	}	public void setCreateDate(String createDate) {		this.createDate = createDate;	}}